function calculate3YrCAGR(prices, latestPrice) {
  const currentYear = new Date().getFullYear();
  const yearData = prices.find(yearData => yearData.year === currentYear - 3);
  if (yearData && yearData[months[new Date().getMonth()]] !== "NA") {
